import React from 'react';
import {DATA} from '../'

const Product = () => {
  return (
    <div>
      <div className="container py-5">
        <div className="row">
          <div className="col-12 text-center">
            <h1>Products</h1>
            <hr></hr>
          </div>
        </div>
      </div>
      <div className="container">
        <div className="row">{DATA.map(cardItem)}</div>
      </div>
    </div>
  );
};

export default Product;
